(12900,	'contando histórias',	'Manuel e Joaquim passeavam pela rua, quando encontraram uma bosta no chão:\r\n- Manuel! Te dou 1.000 Reais se tu comerers essa bosta...\r\n- Então esta combinado, Joaquim...\r\nManuel foi lá e comeu a bosta, ganhando os 1.000 reais... Continuaram andando quando encontraram outra bosta no chão:\r\n- Joaquim! Agora sou eu quem te dou os 1.000 Reais se tu comer essa bosta...\r\n- Então está beleza!!!\r\nO Joaquim se abaixou e comeu a bosta também...\r\nMORAL: Os dois portugueses comeram bosta de graça...',	2,	0,	'#FFFDD6',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'341',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
