(12910,	'contando histórias',	'O português viajava pela estrada com sua família, numa Besta quando, por excesso de velocidade e parado pelo guarda:\r\n- Muito bem, espertinho, posso ver os documentos da Besta?\r\n- Estão aqui, seu guarda... responde, entregando os seus documentos pessoais.\r\n- Não, não! Eu quero ver os documentos da perua! diz o guarda Então, o português vira-se para sua mulher e diz:\r\n- Querida, então é com você... ',	1,	0,	'#61D4FF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	13,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'472',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
(12911,	'contando histórias',	'Chegou um arqueiro americano, botou uma maçã na cabeça de um cobaia e atirou... Acertou em cheio na maçã, então exclamou comemorando :\r\n- I\'M HE-MAN !\r\nDepois veio um Japonês e acertou na flecha do americano dividindo a flecha ao meio e exclamou :\r\n- I\'M SAMURAI !\r\nEntão veio um Português, mirou, e acertou em cheio no olho do cobaia, desfigurando a cabeça do coitado então ele exclamou:\r\n- I\'M SORRY !!! ',	2,	0,	'#F9FF73',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'64',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
(12912,	'contando histórias',	'O pneu do carro do Manuel fura diante de um hospício. Ele desce e tira as porcas da roda, mas elas escorregam para dentro de um bueiro. Um dos\r\ninternos assiste a cena do lado de dentro das grades do manicômio e aconselha ao Manuel:\r\n- Tire uma porca de cada uma das três rodas para segurar a que ficou solta, até chegar a um posto.\r\n- Fenomenal! Muito boa idéia. Obrigado! Olhe, eu nem sei por que tu estas aí dentro.\r\n- Eu estou aqui porque sou doido, não porque sou burro! ',	1,	0,	'#FFC740',	'',	'',	'',	'',	0,	'',	'',	49,	0,	16,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'469',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
