(12936,	'contando histórias',	'Estava um grupo de amigos reunido na comemoração de bodas de ouro do casal.\r\nJoaquim Manuel e Maria, quando um dos convidados começa a contar uma piada:\r\n- Aí o português...\r\nNo que foi prontamente interrompido pelos demais:\r\n- Não conta essa não, que aqui na festa ta cheio de português!\r\n- Não tem problema, eu repito, repito ate eles entenderem...',	1,	0,	'#BAFF80',	'',	'',	'',	'',	0,	'',	'',	49,	7,	13,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'169',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
