(12940,	'contando histórias',	'Joaquim José estava a querer mandar um presente do Brasil para Maria, sua esposa além-mar. Passeando pelas ruas do Rio, encontrou uma caixa de fósforos tamanho família.\r\nEmpacotou e mandou para Portugal. Meses após no telefone...\r\n- Oh Maria, gostaire do presente que te mandei?\r\n- Oh Joaquim José, gostaire eu gostei, mas todos os fósforos não funcionam!\r\n- Oh Maria! Você não estás a saber usaire!\r\nTestei todos antes de te mandar! Acendi um por um e todos funcionaram!!!\r\n',	2,	0,	'#F9FF73',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'64',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
(12941,	'contando histórias',	'Joaquim José estava a querer mandar um presente do Brasil para Maria, sua esposa além-mar. Passeando pelas ruas do Rio, encontrou uma caixa de fósforos tamanho família.\r\nEmpacotou e mandou para Portugal. Meses após no telefone...\r\n- Oh Maria, gostaire do presente que te mandei?\r\n- Oh Joaquim José, gostaire eu gostei, mas todos os fósforos não funcionam!\r\n- Oh Maria! Você não estás a saber usaire!\r\nTestei todos antes de te mandar! Acendi um por um e todos funcionaram!!!',	2,	1,	'#F9FF73',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'pt',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'64',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(12942,	'contando histórias',	'O Joaquim (o mesmo da Maria) quando mandou trazer a Maria, pelo correio, para o Brasil. Abriu um boteco na praça Mauá e colocou a Maria para morar lá perto. Um belo dia.\r\n- JOAQUIMM!! JOAQUIM JOSÉ!!! Tua esposa ta na tua casa na cama com outro cara!!!\r\nCorre lá!\r\n- O que esta gaja prostituta estais a fazer com este paneleiro! Vou pegar a peixeira e a garrucha e vou lá acabar com isso de uma vez!!!\r\nE lá foi o gajo.\r\n5 minutos depois volta o gajo feliz e contente.\r\n- Joaquim! Você matou o cara?!?\r\n- Não. O gajo se enganou. Não era outro, mas o mesmo de sempre!!! ',	1,	0,	'#EFCFFF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	16,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'50',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
(12943,	'contando histórias',	'O português vai até seu chefe (português também):\r\n- Chefe, nossos arquivos estão abarrotados. Será que nos não poderíamos jogar fora as pastas e documentos com mais de vinte anos???\r\n- Ótima idéia! Mas antes tire uma copia de tudo. ',	2,	0,	'#9EC0FF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1506',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
(12944,	'contando histórias',	'Um português telefona para o redator do Livro do Records (The Guinness Book of Records) e comunica:\r\n- Eu acabo de resolver um quebra-cabeças de 3000 peças.\r\n- Mas isto não e tão especial - comenta o redator, meio confuso.\r\nE o português continua:\r\n- Mas eu o resolvi em apenas uma semana. \r\n- Isto também não e tão difícil de se fazer - responde o homem do Guinness.\r\n- Claro que é, meu amigo - diz o português já brabo - Na caixa está escrito de 3 a 5 anos!',	1,	0,	'#DBFF7D',	'',	'',	'',	'',	0,	'',	'',	49,	0,	16,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'95',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
(12945,	'contando histórias',	'A vendedora pergunta a jovem cliente (portuguesa) que tenta comprar um espelho:\r\n- Tem que ser um espelho de mão, senhorita?\r\nE a portuguesa:\r\n- Não. Eu gostaria de poder ver a minha face. ',	1,	0,	'#F3FFC4',	'',	'',	'',	'',	0,	'',	'',	49,	0,	16,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'382',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(12946,	'contando histórias',	'Um turista brasileiro pega uma rodovia em Portugal com destino a Madri. Em dúvida, ainda perto de Lisboa pergunta a um sujeito num posto de gasolina:\r\n- Esta estrada vai para a Espanha? \r\n- U, raios, não sei, mas se for vai fazer muita falta!',	1,	0,	'#FFF29C',	'',	'',	'',	'',	0,	'',	'',	49,	0,	5,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'438',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
(12947,	'contando histórias',	'O Manoelzinho chega para o pai e pediu:\r\n- Papai, deixa eu ir na rua para ver o eclipse?\r\nO português coçou o bigode, olhou bem para o filho e, com um ar autoritário, disse:\r\n- Está bem, mas não chegue muito perto...',	1,	0,	'#FBFF36',	'',	'',	'',	'',	0,	'',	'',	49,	34,	17,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'926',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
(12948,	'contando histórias',	'Recebendo o diplomata português na corte, a rainha Elizabeth, da Inglaterra convidou-o para dar uma volta pelas ruas de Londresnuma carruagem real. De repente, um dos cavalos solta um tremendo pum. A rainha, perde complemente o rebolado, fica toda sem graça e diz:\r\n- Peço mil perdões, mister Antunes... Não sei como isso pode acontecer.\r\nE o diplomata lusitano, todo boas maneiras:\r\n- Não ha de que, Majestade... Eu ate pensei que tivesse sido o cavalo!',	2,	0,	'#C7E6FF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'488',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
