(12950,	'contando histórias',	'Um português queria saber quanto tempo demorava um vôo do Brasil para Portugal, então ligou para uma agência de viagem:\r\n- Por favoire, quanto tempo leva um vôo daqui para Lisboa ?\r\n- Só um minutando... - respondeu a secretaria.\r\n- Obrigado ora pois.',	1,	0,	'#40E8FF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	17,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1416',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
(12951,	'contando histórias',	' Em Portugal, estavam demolindo um velho casarão. Depois de quebrarem boa parte, descobriram, atrás de uma parede, um esqueleto com um cinturão e uma fivela de ouro. Estava escrito no cinturão:\r\nMANOEL - CAMPEÃO MUNDIAL DE ESCONDE-ESCONDE DE 1904',	1,	0,	'#E3FFC4',	'',	'',	'',	'',	0,	'',	'',	49,	0,	16,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1500',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
(12952,	'contando histórias',	'O portuga estava doente e foi ao médico. Este colocou o estetoscópio nas costas dele e ordenou:\r\n- Seu Manoel, fala três vezes 33! \r\nE o portuga nada... o médico ordenou novamente:\r\n- Fala três vezes 33!\r\nO Manoel quietão. O médico ficou irritado e disse:\r\n- Vamos, seu Manoel! Fala três vezes 33!\r\nO Manoel, fazendo um esforço enorme, respondeu:\r\n- 99... ufa...',	2,	0,	'#F9FF73',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'64',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
