(12991,	'leia provérbios',	'Um português queria saber quanto tempo demorava um vôo do Brasil para Portugal, então ligou para uma agência de viagem:\r\n- Por favoire, quanto tempo leva um vôo daqui para Lisboa ?\r\n- Só um minutando... - respondeu a secretaria.\r\n- Obrigado ora pois.',	1,	1,	'#12D6FF',	'',	'',	'',	'',	0,	'',	'',	36,	0,	17,	'pt',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'562',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
