(13155,	'contando histórias',	'Um dia, o Sr. Manuel, um português de 70 anos, estava no bar conversando com uns amigos e ouviu uma notícia surpreendente: pão era afrodisíaco. Ele foi correndo pra padaria do conterrâneo Joaquim e pediu:\r\n- Joaquim, por favor, eu quero 20 pães!\r\n- Mas Sr. Manuel, o senhor mora apenas com a D. Maria. Se o senhor comprar 20 pães a metade vai ficar dura !\r\n-Ahh... entao eu quero 40 Pães!!!\r\n-Ahh... entao eu quero 40 Pães!!! \r\n-Ahh... entao eu quero 40 Pães!!!  ',	1,	0,	'#FCFF61',	'',	'',	'',	'',	0,	'',	'',	49,	0,	14,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1039',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
