(15183,	'contando histórias',	'Outro dia vi no noticiário que um caminhão cheio de pastas suspensas foi sequestrado. Mais tarde, no mesmo dia, um outro carregado de post-its foi roubado.\r\n\r\nAs autoridades ainda estão investigando, mas acreditam que os roubos tenham sido obra do crime organizado.',	2,	0,	'#FF8F05',	'',	'',	'',	'',	0,	'',	'',	49,	0,	2,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1449',	'',	0,	'',	'5',	'',	'0',	'0',	'0',	'',	''),
(15184,	'contando histórias',	'O jovem queria entrar para a polícia. Inscreveu-se e foi chamado para um teste.\r\nNeste teste é necessário ter raciocínio rápido – alertou o examinador.\r\nO que foi que disse?\r\nQue está dispensado.',	1,	0,	'#F5003D',	'',	'',	'',	'',	0,	'',	'',	49,	2,	2,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1527',	'',	0,	'',	'5',	'2',	'0',	'0',	'0',	'',	''),
(15185,	'contando histórias',	'A mulher do Epaminondas sumiu e, uma semana depois, ele resolveu dar queixa na polícia.\r\nO senhor tem uma foto dela? – indagou o delegado.\r\nSim, aqui está.\r\nApós olhar o retrato, o policial perguntou:\r\nO senhor quer mesmo que a procuremos?',	2,	0,	'#9CEDFF',	'',	'',	'',	'',	0,	'',	'',	49,	10,	3,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1223',	'',	0,	'',	'5',	'',	'0',	'0',	'0',	'',	''),
(15186,	'contando histórias',	'Minha prima estava no caixa da padaria certa manhã quando um homem armado entrou e pediu todo o dinheiro. Enquanto o entregava, ela notou os rolos de moedas na parte de trás do caixa.\r\n\r\n– Você quer os rolinhos também?\r\n\r\n– Não – disse o ladrão, sacudindo a arma –, só o dinheiro.',	1,	0,	'#F5003D',	'',	'',	'',	'',	0,	'',	'',	49,	10,	3,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1527',	'',	0,	'',	'5',	'',	'0',	'0',	'0',	'',	''),
