(15196,	'contando histórias',	'Biologia Animal\r\nA professora explicava:\r\n\r\n- O animal que tem 4 pés é um quadrúpede.\r\n\r\nEm seguida olha para um dos alunos e pergunta:\r\n\r\n- Você que tem 2 pés como é o nome?\r\n\r\n- Ana.',	2,	0,	'#6BFFD8',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1647',	'',	0,	'',	'5',	'',	'0',	'0',	'0',	'',	''),
(15197,	'contando histórias',	'Conversa de Caminhões\r\nO caminhão Scania diz para o Volvo.\r\n\r\n- Nossa, que fome!\r\n\r\nO Volvo responde:\r\n\r\n- Nossa, também estou com fome!\r\n\r\nE o Scania convida:\r\n\r\n- Partiu ro-diesel?',	2,	0,	'#FF1414',	'',	'',	'',	'',	0,	'',	'',	49,	6,	0,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1601',	'',	0,	'',	'5',	'',	'0',	'0',	'0',	'',	''),
(15198,	'contando histórias',	'Fui na padaria e perguntei:\r\n\r\n- Moça tem pão?\r\n\r\nE ela respondeu:\r\n\r\n- Nossa, tempão mesmo, hein?\r\n\r\nDaí nos abraçamos e choramos juntos.',	0,	0,	'#FF0000',	'',	'',	'',	'',	0,	'',	'',	49,	0,	2,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1354',	'',	0,	'',	'5',	'',	'0',	'0',	'0',	'',	''),
