(15201,	'contando histórias',	'Na escola, a professora vai explicando:\r\n\r\n- Se digo que fui rica é passado. Então, Mariazinha se digo que serei diretora, o que é?\r\n\r\n- Futuro, professora.\r\n\r\n- E Joãozinho, se digo que sou bonita, é o quê?\r\n\r\n- Mentirosa.',	0,	0,	'#F57C4C',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1531',	'',	0,	'',	'5',	'',	'0',	'0',	'0',	'',	''),
