(15203,	'contando histórias',	'Pergunta de Cobra\r\nUma cobra pergunta à outra:\r\n\r\n- Será que sou muito venenosa?\r\n\r\n- Achou que sim. Por quê?\r\n\r\n- Mordi a língua.',	2,	0,	'#F5BAFF',	'',	'',	'',	'',	0,	'',	'',	49,	16,	3,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1002',	'',	0,	'',	'5',	'',	'0',	'0',	'0',	'',	''),
