(15205,	'contando histórias',	'Mangas Nas Mãos\r\nA professora pergunta a Joãozinho:\r\n\r\n- Joãozinho, se eu tenho duas mangas em uma mão e duas na outra, o que eu tenho?\r\n\r\n- Mãos grandes, fessora!',	2,	0,	'#FFD4F3',	'',	'',	'',	'',	0,	'',	'',	49,	6,	2,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'25',	'',	0,	'',	'5',	'',	'0',	'0',	'0',	'',	''),
(15206,	'contando histórias',	'Algo Para Beber\r\nNum avião a comissária de bordo pergunta:\r\n- Vai desejar alguma coisa para beber?\r\nE o senhor pergunta:\r\n- Quais são as opções?\r\nE a comissária de bordo responde:\r\n- Sim e não!',	2,	0,	'#FF8F05',	'',	'',	'',	'',	0,	'',	'',	49,	0,	2,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1449',	'',	0,	'',	'5',	'2',	'0',	'0',	'0',	'',	''),
(15207,	'contando histórias',	'Fazendo Sopa\r\nSeu Lunga estava doente e a esposa se propôs a fazer uma sopa. Quando terminou gritou da cozinha:\r\n\r\n- Lunga você quer que eu coloque a sopa em um prato e leve para você?\r\n\r\nEle respondeu:\r\n\r\n- Não, jogue no chão em empurre com um rodo!',	2,	0,	'#FF0000',	'',	'',	'',	'',	0,	'',	'',	49,	27,	2,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1345',	'',	0,	'',	'5',	'',	'0',	'0',	'0',	'',	''),
