(15210,	'contando histórias',	'Bêbado Entrando na Igreja\r\nUm bêbado entra numa igreja e escuta o pastor falando:\r\n\r\n-Sai Satanás, sai!\r\n\r\nO bêbado se irrita e diz:\r\n\r\n- Já tô indo embora e não volto mais!',	2,	0,	'#009DFF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	2,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1087',	'',	0,	'',	'5',	'',	'0',	'0',	'0',	'',	''),
(15211,	'contando histórias',	'O professor fazendo uma pequena revisão do assunto da aula passada pergunta ao aluno mais despercebido da sala:\r\n\r\n- Onde foi assinado o tratado de Tordesilhas?\r\n\r\n- Ora fessô, no final da folha?\r\n\r\n- Ganhou 10, miserável!',	0,	0,	'#EBFFD4',	'',	'',	'',	'',	0,	'',	'',	49,	0,	2,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1217',	'',	0,	'',	'5',	'',	'0',	'0',	'0',	'',	''),
(15212,	'contando histórias',	'Pão de Queijo Afrodisíaco\r\nFalaram para o português que pão de queijo era afrodisíaco, então ele foi na padaria e pediu 50 pães de queijo. O vendedor surpreso com o pedido disse:\r\n\r\n- Mas, senhor... metade vai endurecer!\r\n\r\nO português disse:\r\n\r\n- Me dá 100 então!',	2,	0,	'#F5003D',	'',	'',	'',	'',	0,	'',	'',	49,	10,	2,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1527',	'',	0,	'',	'5',	'',	'0',	'0',	'0',	'',	''),
