(15214,	'contando histórias',	'Subtração do Joãozinho\r\nA professora pergunta:\r\n\r\n- Joãozinho, quantos que é 1 - 1?\r\n\r\n- É 1, professora.\r\n\r\n- Não, Joãozinho. Eu vou dar um exemplo. Eu tenho uma manga, eu a comi. O que sobrou?\r\n\r\n- Sobrou o caroço.',	1,	0,	'#3066FF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'pt',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'770',	'',	0,	'',	'5',	'',	'0',	'0',	'0',	'',	''),
